Todos los programas de Arduino comienzan con la plantilla siguiente void setup() {
} void loop() {
} El código previo al método "setup" generalmente se usa para la creación de variables globales y constantes (las cuales usaremos bastante), en la sección de "setup" irá el código necesario para inicializar nuestras variables, establecer funcionalidad de los pines de nuestra ESP-32 y demás configuraciones iniciales. En "loop" estará el grueso de nuestro código, aquí es donde tendremos que tener suma precaución al momento de programar ya que este es el código que se ejecutará de manera cíclica una y otra vez. Hay que recordar, la ESP-32 únicamente la usaremos como un medio de comunicación entre los convertidores analógico-digitales (ADC) a la computadora (en la aplicación de Java). Es por esto que en realidad el código será bastante conciso. Un pseudocódigo más o menos funcional que represente lo que buscamos hacer sería: int lectura_ADC_A
int lectura_ADC_B
int pin_ADC_A
int pin_ADC_B int resta_ADC_AB inicializa(){ //De este valor dependerá la velocidad de operación de la ESP32 configurar_reloj_ESP32 //De este valor dependerá nuestra velocidad de envío configurar_tasa_baudios_monitor_serial(máximo_valor_estable) //De este valor dependerá nuestra calidad de lectura configurar_resolución_ADC(máximo_valor_estable) } ciclo(){ //Leemos los valores de las terminal positiva (A) y la terminal negativa (B) lectura_ADC_A = leer(pin_ADC_A) lectura_ADC_B = leer(pin_ADC_B) //Al valor de la terminal positiva restarle el valor de la terminal negativa resta_ADC_AB = lectura_ADC_A - lectura_ADC_B //Mandamos el valor a la computadora mandar_serial(resta_ADC_AB)
} Este pseudocódigo describe mayormente el funcionamiento del código final. En realidad, este fue el primer código que se utilizó para intentar hacer funcionar el osciloscopio. Hay ciertos detalles que hacen que sea ineficiente, lento, variable y poco predecible. Es por eso que se tuvieron que realizar bastantes cambios a este código. Desafortunadamente, las optimizaciones que se realizaron en este rubro del diseño superan muy rápidamente el nivel básico de usuario por lo que en realidad se recomienda que no se manipule el código a menos que uno realmente sepa lo que está haciendo.
